import React from 'react';
import {motion} from 'framer-motion';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <motion.div 
      animate = {{y: "100px"}}
      id="map">
      text
    </motion.div>
  );
}

export default App;



